?><p style="font-family: Arial, Verdana, sans-serif; font-size: 12px; text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Эта известная немецкая компания по производству часов была основана в 1927 году. Ее основатель Вальтер Сторз, сразу после окончания учебы, мечтал создать компанию, которая бы помогала развитию авиационной и морской промышленности. Вскоре, он решил, что для моряков и летчиков необходимы точнейшие механизмы, которые бы помогали им в навигации. Это и было первоначальной концепцией этой компании. Ее название происходит от первых букв инициалов создателя. Уже в начале 40-х годов 20-го века, компания&nbsp;<span lang="EN-US">Stowa</span><span lang="EN-US">&nbsp;</span>считалась одним из лидеров среди компаний, которые производили приборы для военных. Но, к сожалению, в конце Второй Мировой войны, фабрика этой компании была разрушена из-за налета вражеских самолетов. Всего за 6 лет завод удалось восстановить. Уже в 1951 году, был восстановлен старый, и построен новый завод. Сразу же после восстановления компании, ей удалось завоевать неимоверную популярность, которая обеспечила многочисленные продажи в, более чем, 80-ти странах. В современном производстве своих часов, компания старается сохранить свою первоначальную историческую идею. Эту самую идею дизайнеры компании пытаются вложить в концепцию часов. На данный момент, часы&nbsp;<span lang="EN-US">Stowa</span>&nbsp;– это успешная реализация военных часов прошлых лет. Они отлично подойдут, как военным, так и гражданским людям, которые предпочитают строгий дизайн вместе с высоким качеством и точностью.</span></span></p>

